import { useState, useEffect } from "react";
import {
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  FormHelperText,
} from "@mui/material";
const DynamicPricingJiji = () => {
  const [manfacturedate, setManfacturedate] = useState(new Date());
  const [deleveryDate, setDeleveryDate] = useState(new Date());
  const [cost, setCost] = useState(new Date());
  const [ram, setRam] = useState();
  const [CPU, setCPU] = useState({});
  const [pcType, setPcType] = useState([]);
  const [computerModel, setComputerModel] = useState([]);
  const [windowsVersion, setWindowsVersion] = useState([]);
  const [storage, setStorage] = useState([]);
  const [currencyRate, setCurrencyRate] = useState([]);
  const [purpose, setpurpose] = useState([]);
  const [values, setValues] = useState([]);
  const [screenType, setScreenType] = useState([]);
  const [amountOrdered, setAmountOrdered] = useState([]);
  const [HDD, setHDD] = useState([]);
  const [SSD, setSSD] = useState([]);
  const [Resolution, setResolution] = useState([]);
  const [GPU, setGPU] = useState([]);
  const [Size, setSize] = useState([]);
  const calcuateDynamicPricing = () => {
    let days = 5;
    if (purpose == "gaming") {
      if (storage == 1) {
        if (screenType == 1) {
          if (CPU == 7) {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              10320 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              6540 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          }
        } else {
          if (CPU == 7) {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              10320 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else {
            let cost =
              22500 +
              3000 * SSD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              6540 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          }
        }
      } else {
        if (screenType == 1) {
          if (CPU == 7) {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              10320 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              6540 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          }
        } else {
          if (CPU == 7) {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              10320 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else {
            let cost =
              22500 +
              900 * HDD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              6540 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          }
        }
      }
    } else if (purpose == "BusinessAndProffessional") {
      if (storage == 1) {
        if (screenType == 1) {
          if (CPU == 7) {
            let cost =
              12500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              12500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              10320 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else {
            let cost =
              12500 +
              3000 * SSD +
              21 * ram +
              9000 +
              0.00025 * Resolution +
              36000 / GPU +
              6540 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          }
        } else {
          if (CPU == 7) {
            let cost =
              12500 +
              3000 * SSD +
              21 * ram +
              0.00025 * Resolution +
              36000 / GPU +
              24000 * CPU -
              4500 * (days / 365) -
              (Size / 1000) * 22500;
            setValues(cost);
          } else if (CPU == 5) {
            let cost =
              12500 +
              3000 * SSD +
              21 * ram +
              0.00025 * Resolution +
